package oops;

public class ObjectREfer {
	
	private int nu;
	private String name;
	


	public ObjectREfer(int nu, String name) {
		super();
		this.nu = nu;
		this.name = name;
	}


	public ObjectREfer() {
		// TODO Auto-generated constructor stub
	}


	public int getNu() {
		return nu;
	}


	public void setNu(int nu) {
		this.nu = nu;
	}


	public String getName() {
		return name;
	}


	public void setName(String name) {
		this.name = name;
	}

}
